from juriscraper.opinions.united_states.state import pa
from datetime import date
import re


class Site(pa.Site):
    def __init__(self):
        super(Site, self).__init__()
        self.court_id = self.__module__
        self.url = "http://www.pacourts.us/courts/superior-court/court-opinions/Default.aspx"
        self.parameters = {
            '__VIEWSTATE': "",
            'CourtType': "superior",
            'PublicationTypeSearch': "",
            'PostingTypeSearch': ["1", "2", "3", "4"],
            'CaptionSearch': "",
            'AuthorSearch': "",
            'MinDateSearch': self.case_date.strftime('%m/%d%Y'),
            'MaxDateSearch': self.case_date.strftime('%m/%d%Y'),
            'MonthSearch': "0",
            'YearSearch': "",
            'SortOrder': "desc",
            'FormButton': "Search"
        }

    def _get_case_names(self):
        path = "//*[contains(concat(' ',@id,' '),' CaptionView')]/text()[1]"
        return list(self.html.xpath(path))

    def _get_precedential_statuses(self):
        path = "//*[contains(concat(' ',@id,' '),' PublicationTypeView')]/text()"
        return list(self.html.xpath(path))

    def _get_docket_numbers(self):
        path = "//*[contains(concat(' ',@id,' '),' CaptionView')]/text()[2]"
        return list(self.html.xpath(path))